import { useContext } from "react";
import { Table } from "reactstrap";
import { DivHeaderTable, Tr, Th, ButtonPost } from "./style";
import { Context } from "../../hooks/DataProvider";

const Tables = () => {
  const { file, setFile } = useContext(Context);
  const data = file.data;

  console.log(data);

  function subString(string, number) {
    let result;
    if (string.length > number) {
      result = string.substring(0, number - 1) + "...";
    }
    return result;
  }

  return (
    <>
      {data.length > 0 && (
        <>
          <DivHeaderTable>
            <div className="child-1">{data.length - 1}</div>
            <div className="child-2">
              listings successfully and Ready to published
            </div>
            <div className="child-3">
              <i className="fas fa-history"></i> Update data
            </div>
            <div className="child-4">
              <i className="far fa-window-maximize" />
            </div>
            <div className="child-5">Published</div>
          </DivHeaderTable>
          <Table responsive>
            <thead>
              <tr>
                <th></th>
                <th>CONDO NAME</th>
                <th>RENT PRICE (Baht)</th>
                <th>SELL PRICE (Baht)</th>
                <th>BEDROOM</th>
                <th>BATHROOM</th>
                <th>SIZE (sqm.)</th>
                <th>FLOOR </th>
                <th>STATUS </th>
                <th>PHOTO </th>
                <th>TITLE </th>
                <th>DESCRIPTION </th>
                <th>BENEFIT </th>
                <th>Amenities </th>
              </tr>
            </thead>
            <tbody>
              {data.map((file, index) => {
                const object = { ...file };
                let id = object["0"];
                let name = subString(object["1"], 20);
                let rate_price = object["2"];
                let sale_price = object["3"];
                let bad_room = object["4"];
                let bath = object["5"];
                let size = object["6"];
                let floor = object["7"];
                let title = subString(object["8"], 20);
                let description = subString(object["9"], 20);
                let photo = object["10"];
                let agen_post = object["11"];
                let accept_agent = object["12"];
                let air_con = object["13"];
                let bath_tub = object["14"];
                let electric_stove = object["15"];
                let furniture = object["16"];
                let gas_stove = object["17"];
                let refrigerator = object["18"];
                let washing_machine = object["19"];
                let Water_heater = object["20"];
                if (index > 0) {
                  return (
                    <>
                      <Tr>
                        <Th scope="row">{id}</Th>
                        <Th value={name}>
                          <span>{name ? name : "notfound"}</span>
                        </Th>
                        <Th>{rate_price}</Th>
                        <Th>{sale_price}</Th>
                        <Th>{bad_room}</Th>
                        <Th>{bath}</Th>
                        <Th>{size}</Th>
                        <Th>{floor}</Th>
                        <Th>
                          <ButtonPost>Agent post</ButtonPost>
                          <ButtonPost>Agent post</ButtonPost>
                        </Th>
                        <Th>
                          <div className="img">
                            <img src={`${photo}`} />
                            <img src={`${photo}`} />
                            <img src={`${photo}`} />
                            <img src={`${photo}`} />
                          </div>
                        </Th>
                        <Th value={title}>
                          <span>{title ? title : "notfound"}</span>
                        </Th>
                        <Th>{description}</Th>
                        <Th>-</Th>
                        <Th>{object["20"]}</Th>
                      </Tr>
                    </>
                  );
                }
              })}
            </tbody>
          </Table>
        </>
      )}
    </>
  );
};

export default Tables;
